  ],
  worker: true,
  category: 'geometry',
  options: {
    mvt: {
      shape: 'geojson',
      coordinates: 'local',
      layerProperty: 'layerName',
      layers: undefined,
      tileIndex: undefined
    }
  }
};
/**
 * Loader for the Mapbox Vector Tile format
 */
export const MVTLoader = {
  ...MVTWorkerLoader,
  parse: async (arrayBuffer, options) => parseMVT(arrayBuffer, options),
  parseSync: parseMVT,
  binary: true
};
